(1, 'Nombre de pruebas de Castanae', 'pruebas.castanae@hotmail.com', '111111111', 'Esto es una prueba de contacto desde la web Castanae. Ignórala.\r\n\r\nLa hora de envío está 2 horas retrasada respecto a la hora real de la solicitud de contacto. El motivo es que el reloj del servidor de Hostinger está sincronizado con otra franja horaria.\r\n\r\nSaludos,\r\nJose\r\n', '2014-06-12 14:38:49', 0),
