(3, 'Marta Rodriguez Guitián', 'hola@martaguitian.es', '616250447', 'Hola:\r\nMe gustaría probar algunos de los productos que elaboran, ¿dónde podría encontrarlos? Yo vivo en Lugo. \r\nTambién me gustaría saber si la tarta de zanahoria o la rosca de castaña se elaboran con leche. Gracias. \r\nUn saludo.', '2015-12-12 16:48:25', 0),
(4, 'Silvia', 'silvia_lugo_66@hotmail.com', '663586401', 'Buenos días,\r\n\r\nCual sería el precio de la rosca de castaña?\r\n\r\nNecesitariamos dos para el sábado, habría que ir a recogerlos a O Corgo?\r\n\r\nGracias,', '2016-04-15 06:42:17', 0),
(5, 'XISELA FERNANDEZ', 'xsl.fernandez@gmail.com', '660198943', 'Buenas tardes,\r\n\r\nSomos una pequeña empresa de produccion de harinas especiales. Empezamos este año con la produccion de harina de castaña de procedencia ecológica mediante molienda con molino de piedra.\r\n\r\nSi están interesados en la comercializacion de la harina no duden en ponerse en contacto con nosotros\r\n\r\nUn saludo', '2016-06-27 17:14:44', 0),
(6, 'trini', 'trinisantaluci@gmail.com', '', 'Sanitas	SALUD PROFESIONALES\r\n\r\nPrecio		con copago				sin copago	\r\n0-54		32€ por asegurado			48€ por asegurado\r\n\r\n55-75		49,95€ por asegurado			65€ por asegurado\r\n\r\n\r\nVENTAJAS FISCALES\r\nAUTONOMO: DEDUCE HASTA 500€ POR ASEGURADO\r\nEMPRESA CON PERSONA JURICICA: TODA LA PRIMA ES GASTO DEDUCIBLE EN EL IMPUESTO DE SOCIEDADES\r\n\r\nProducto de asistencia sanitaria completa, con acceso a todas las especialidades médicas y hospitalización, a través del amplio cuadro médico de Sanitas, formado por más de 40.000 profesionales y 1.200 centros médicos 3 hospitales propios, 19 centros Milenium Multiespecialidad y más de 170 Clínicas Milenium Dental.\r\nEn esta modalidad de seguro la cobertura se presta exclusivamente a través de cuadro médico, a diferencia de los productos de reembolso, donde el asegurado abona al profesional sus honorarios y solicita a la aseguradora su reembolso en los términos pactados en la póliza.\r\nEn este seguro el tomador debe ser trabajador autónomo y acreditarlo. Sin perjuicio de que como asegurados puedan figurar tanto los empleados a su cargo como los familiares del tomador o dichos empleados.\r\n\r\nDESCRIPCIÓN DE LAS GARANTÍAS Y OPCIONES OFRECIDAS\r\nCOBERTURAS INCLUIDAS\r\n• Medicina Primaria: medicina general, pediatría, ATS,\r\nservicios de urgencias.\r\n• Acceso a todas las especialidades médicas:\r\ndermatología, oftalmología, ginecología,\r\ntraumatología, etc.\r\n• Pruebas diagnósticas: ecografías, análisis, radiografías,\r\netc.\r\n• Métodos terapéuticos: sesiones de rehabilitación,\r\ntratamientos oncológicos, etc.\r\n• Intervenciones quirúrgicas: que requieran o no\r\npermanencia en un hospital.\r\n• Hospitalización sin limite\r\n• Cobertura dental: 30 servicios incluidos y descuentos\r\ndel 21% en resto de tratamientos.\r\n• Protección Total: coberturas específicas para cubrir\r\nlas necesidades del autónomo ante una baja por\r\nhospitalización o incapacidad temporal.\r\n• Accidentes de tráfico y laborales: asistencia sanitaria\r\nen caso de accidentes de tráfico o laborales.\r\n• Segunda opinión médica: solicitada a especialistas de\r\nnivel mundial.\r\n• Atención de urgencias en viajes al extranjero.\r\n\r\nCOBERTURAS OPCIONALES\r\n• Reembolso: acceso a cualquier especialista aunque no\r\nesté en el cuadro médico de Sanitas. El porcentaje y\r\nlímites de capital asegurado serán los establecidos en\r\nla póliza.\r\nPara más información consulte las Condiciones Generales del producto en la web www.sanitas.es\r\nNOTA PREVIA INFORMATIVA REALIZADA EN NOVIEMBRE DE 2015\r\n5.\r\nAccidentes de tráfico y laborales\r\n•	Asistencia sanitaria como consecuencia de accidentes de tráfico, de trabajo o enfermedad profesional.\r\n\r\nProtección Total\r\n•	Coberturas adicionales diseñadas para cubrir tus necesidades como autónomo y las de tu familia ante una incapacidad laboral.\r\n•	Se presta cuando el  asegurado esté hospitalizado o esté inmovilizado en su domicilio por convalecencia, durante un tiempo superior a 72 horas\r\n•	Aplicable en territorio español, aunque el accidente o enfermedad se haya producido fuera de España. \r\no	 Apoyo en las tareas del hogar\r\no	Cuidado de los hijos y apoyo escolar a domicilio\r\no	Envío a domicilio de medicamentos y correspondencia\r\no	Servicio de taxi para las gestiones diarias\r\no	Fisioterapia a domicilio\r\no	Asistencia informática para la instalación del puesto de trabajo en casa.\r\no	Te llevamos el correo de tu oficina a casa.\r\n\r\nOtros servicios y garantías\r\n•	Segunda opinión médica.\r\n•	Asistencia de urgencias en el extranjero (hasta 12.000 euros por asegurado y siniestro).\r\n•	Asesoramiento telefónico para enfermedades crónicas a través de “Sanitas Responde”.\r\n\r\n\r\n\r\nSalud Profesionales y Salud Profesionales Plus\r\n•	Seguros de cobertura completa, a través de cuadro médico, con o sin copago.\r\n•	Son seguros de contratación exclusiva para autónomos, sus familiares directos y/o empleados que puedan tener.\r\n•	Incluye “Sanitas Dental 21”, un seguro de asistencia bucodental con más de 30 servicios gratuitos y precios franquiciados.\r\n\r\n\r\nPara más información remítanme un email y me pondré en contacto lo antes posible\r\nGracias \r\ntrinisantaluci@gmail.com\r\n', '2016-07-16 09:34:50', 0),
