(8, 'Ivàn Nogueira Anido...Multitienda Casa Cotón', 'broches.lugo.2013@gmail.com', '617123201', 'Buenas tardes, \r\nEn Junio abrimos una pequeña tienda en LLugo y nos interesa el bizcocho de nuez o la rosca de castaña...\r\nPodrían indicarnos precios o si tienen comercial por la zona?\r\n\r\nMuchas gracias!', '2016-10-02 16:35:43', 0),
