(12, 'Begoña Fontenla', 'begona.fontenla@crtvg.es', '636168508', 'Ola Anjhara! chameite varias veces pero non logro contactar contigo por tfno así que probo por aquí. Era para avisarte de que hoxe sae a reportaxe que fixemos na túa casa, vale? \r\nLogo, a partir das tres, queda colgada na páxina web www.crtvg.es, e alí podes vela e, se queres, compartir o link na túa páxina.\r\nMil bicos e a ver se che gusta.\r\npd: por certo, todo boísimo, un éxito os doces! canto tempo poden durar ao non ter conservantes?\r\nBicos e gracias por todo. Feliz Ano!!', '2017-01-05 11:44:33', 0),
